import React, { useEffect } from 'react'
import axios from 'axios'
import phones from "../images/phones.png"
// import phone from "../images/phone.png"


function Mobiles() {


    useEffect(
        () =>
    axios.get("http://localhost:3003/data")
    .then((res) =>{
        console.log(res);
        // setData(res.data);          
  })
    .catch((err) =>{
  console.log(err);
   }),[]
    );


    return (
        <div>
            <div>

            </div>
            <div className="border h-48 flex">
                <div className="border h-full w-3/12 flex justify-center items-center">
                    <img className="h-48" src={phones} alt="" />
                </div>
                <div className="border h-full w-6/12">
                    <h2 className="text-3xl font-semibold">Galaxy S20 Ultra </h2>
                    <h2></h2>
                </div>
                <div className="border h-full w-3/12"></div>
            </div>

        </div>
    )
}

export default Mobiles
